import React from "react";
import { Link } from "react-router-dom";

const Card = (props) => {
    return (
        <>
            <Link>
                <div className="mainCard">
                    <img src={props.image} ></img>
                    <div className="detail">
                        <p>{props.name}</p>
                    </div>
                </div>
            </Link>
        </>
    );
}
export default Card;
